@wearemanenough is a social movement that brings men of all different backgrounds together to discuss masculinity in america. 
hosted by actor, director, and film maker @justinbaldoni , guests are invited to talk about how traditional masculinity impacts their daily lives as well as the women around them. 
although this program is masculinity-focused, it is a great program for all genders to explore as it helps everyone understand the impacts (both good and bad) that masculinity has on our society and the steps we can all take to initiate change.

